        return  {
            trees: response.data
        }
    }
    
    render() {

        const { trees } = this.props;

        if(typeof trees === "undefined") {
            <Layout>
                내 나무 조회
                <ul>
                    {treeList}
                </ul>
            </Layout>
        }
        else {
            const treeList = trees.map(
                tree => <li key={tree.id}>{tree.username}</li>
            )
            return (
                <Layout>
                    내 나무 조회
                    <ul>
                        {treeList}
                    </ul>
                </Layout>
            )
        }
    }

}
export default MyTree;
